: \"Phone number\", \"config\": {\"label\": \"Phone number\", \"mapping\": null, \"settings\": {\"size\": \"small\", \"format\": \"plain\"}}, \"values\": [{\"value\": \"0459058585\"}], \"field_id\": 166217593, \"external_id\": \"phone-number\"}, {\"type\": \"text\", \"label\": \"Email address\", \"config\": {\"label\": \"Email address\", \"mapping\": null, \"settings\": {\"size\": \"small\", \"format\": \"plain\"}}, \"values\": [{\"value\": \"amanda@oneside.com.au\"}], \"field_id\": 166217594, \"external_id\": \"email-address\"}, {\"type\": \"category\", \"label\": \"Is this enquiry for you or on behalf of someone else?\", \"config\": {\"label\": \"Is this enquiry for you or on behalf of someone else?\", \"mapping\": null, \"settings\": {\"display\": \"inline\", \"options\": [{\"id\": 1, \"text\": \"Myself\", \"color\": \"DCEBD8\", \"status\": \"active\"}, {\"id\": 2, \"text\": \"Someone else\", \"color\": \"DCEBD8\", \"status\": \"active\"}], \"multiple\": false}}, \"values\": [{\"value\": {\"id\": 2, \"text\": \"Someone else\", \"color\": \"DCEBD8\", \"status\": \"active\"}}], \"field_id\": 166217597, \"external_id\": \"is-this-enquiry-for-you-or-on-behalf-of-someone-else\"}, {\"type\": \"text\", \"label\": \"If on behalf of another person what is your relationship to them\", \"config\": {\"label\": \"If on behalf of another person what is your relationship to them\", \"mapping\": null, \"settings\": {\"size\": \"small\", \"format\": \"plain\"}}, \"values\": [{\"value\": \"Support Coordinator\"}], \"field_id\": 166217605, \"external_id\": \"if-on-behalf-of-another-person-what-is-your-relationshi\"}, {\"type\": \"text\", \"label\": \"Nature of disability\", \"config\": {\"label\": \"Nature of disability\", \"mapping\": null, \"settings\": {\"size\": \"small\", \"format\": \"plain\"}}, \"values\": [{\"value\": \"Multiple sclerosis\"}], \"field_id\": 166217606, \"external_id\": \"nature-of-disability\"}, {\"type\": \"text\", \"label\": \"Please describe the supports required (eg days/times, activities required)\", \"config\": {\"label\": \"Please describe the supports required (eg days/times, activities required)\", \"mapping\": null, \"settings\": {\"size\": \"large\", \"format\": \"html\"}}, \"values\": [{\"value\": \"<p>Sussan currently resides in an aged care facility. Prior to that Sussan had been living alone at home. Following a fall and a very lengthy hospital stay it was deemed that Sussan could not return home to live alone.</p><p>Sussan was placed in the aged care facility against her wishes and hates it and is desperate to get out</p><p>Sussan will be moving into SDA apartments in Abbotsford. Hopefully by christmas. There is a bit of work to do around funding and supports/equipment to be done before that can happen.</p><p>Sussan will require 2:1 for hoisting (one of these will be the concierge at the SDA) and 1:1 supports during the day x 7 days.</p><p>A lot to be determined and worked out prior.</p><p>Sussan viewed our video for the SDA application and wanted to go ahead with InLife for personal supports.</p><p><br /></p>\"}], \"field_id\": 166217607, \"external_id\": \"please-describe-the-supports-required-eg-daystimes-acti\"}, {\"type\": \"text\", \"label\": \"Suburb\", \"config\": {\"label\": \"Suburb\", \"mapping\": null, \"settings\": {\"size\": \"small\", \"format\": \"plain\"}}, \"values\": [{\"value\": \"Abbotsford\"}], \"field_id\": 166217609, \"external_id\": \"suburb\"}, {\"type\": \"text\", \"label\": \"Anything else you think we should know\", \"config\": {\"label\": \"Anything else you think we should know\", \"mapping\": null, \"settings\": {\"size\": \"large\", \"format\": \"html\"}}, \"values\": [{\"value\": \"<p>Sussan blames everything on the aged care home. She believes her MS is under control and the only issues is her housing.</p><p>Amanda has worked at the MS houses and believes the MS is not under control and therew ill be work to do around that.</p><p>Sussan has chemical sensitivities and needs staff that will refrain from wearing perfumes/strong deodorants. She has trouble with heavily scented products.</p><p>Sussan has been verbally abusive to the aged care staff but Amanda believes that is through frustration and not feeling listened too. Sussan lives in the four walls of her bedroom as she hates being out with the older residents.</p><p>Sussan has put on a lot of weight being in the aged care. She does not like the food and has been ordering in a lot. She has also stopped her swimming and physio ( was 3 times a week) due to COVID.</p><p><br /></p>\"}], \"field_id\": 166217610, \"external_id\": \"anything-else-you-think-we-should-know\"}, {\"type\": \"category\", \"label\": \"Expected time to onboard\", \"config\": {\"label\": \"Expected time to onboard\", \"mapping\": null, \"settings\": {\"display\": \"inline\", \"options\": [{\"id\": 1, \"text\": \"Urgent\", \"color\": \"F7D1D0\", \"status\": \"active\"}, {\"id\": 2, \"text\": \"Short term (next few weeks)\", \"color\": \"FFD5C2\", \"status\": \"active\"}, {\"id\": 3, \"text\": \"Medium term (next couple of months)\", \"color\": \"F7F0C5\", \"status\": \"active\"}, {\"id\": 4, \"text\": \"Long term\", \"color\": \"D2E4EB\", \"status\": \"active\"}, {\"id\": 5, \"text\": \"To be confirmed\", \"color\": \"DCEBD8\", \"status\": \"active\"}], \"multiple\": false}}, \"values\": [{\"value\": {\"id\": 2, \"text\": \"Short term (next few weeks)\", \"color\": \"FFD5C2\", \"status\": \"active\"}}], \"field_id\": 204980990, \"external_id\": \"expected-time-to-onboard\"}, {\"type\": \"date\", \"label\": \"Prev field last updated on\", \"config\": {\"label\": \"Prev field last updated on\", \"mapping\": null, \"settings\": {\"end\": \"disabled\", \"time\": \"disabled\", \"color\": \"DCEBD8\", \"calendar\": false}}, \"values\": [{\"start\": \"2020-11-04 00:00:00\", \"start_utc\": \"2020-11-04\", \"start_date\": \"2020-11-04\", \"start_time\": null, \"start_date_utc\": \"2020-11-04\", \"start_time_utc\": null}