\", \"subscribe\", \"comment\", \"rate\", \"add_task\", \"add_conversation\", \"add_file\"], \"item_id\": 1545204524, \"ratings\": {\"like\": {\"counts\": {\"1\": {\"total\": 0, \"users\": []}}, \"average\": null}}, \"priority\": 1545204524, \"revision\": 10, \"created_by\": {\"id\": 5249482, \"url\": \"https://podio.com/users/5249482\", \"name\": \"Janelle Summers\", \"type\": \"user\", \"image\": {\"link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"file_id\": 1125587823, \"hosted_by\": \"podio\", \"link_target\": \"_blank\", \"thumbnail_link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"external_file_id\": null, \"hosted_by_humanized_name\": \"Podio\"}, \"avatar\": 1125587823, \"user_id\": 5249482, \"avatar_id\": 1125587823, \"avatar_type\": \"file\", \"last_seen_on\": \"2020-11-17 01:45:45\"}, \"created_on\": \"2020-10-14 05:11:07\", \"file_count\": 0, \"app_item_id\": 445, \"created_via\": {\"id\": 1, \"url\": null, \"name\": \"Podio\", \"display\": false, \"auth_client_id\": 1}, \"external_id\": null, \"comment_count\": 4, \"last_event_on\": \"2020-11-05 07:06:37\", \"current_revision\": {\"type\": \"update\", \"user\": {\"id\": 5249482, \"url\": \"https://podio.com/users/5249482\", \"name\": \"Janelle Summers\", \"type\": \"user\", \"image\": {\"link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"file_id\": 1125587823, \"hosted_by\": \"podio\", \"link_target\": \"_blank\", \"thumbnail_link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"external_file_id\": null, \"hosted_by_humanized_name\": \"Podio\"}, \"avatar\": 1125587823, \"user_id\": 5249482, \"avatar_id\": 1125587823, \"avatar_type\": \"file\", \"last_seen_on\": \"2020-11-17 01:45:45\"}, \"revision\": 10, \"created_by\": {\"id\": 5249482, \"url\": \"https://podio.com/users/5249482\", \"name\": \"Janelle Summers\", \"type\": \"user\", \"image\": {\"link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"file_id\": 1125587823, \"hosted_by\": \"podio\", \"link_target\": \"_blank\", \"thumbnail_link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"external_file_id\": null, \"hosted_by_humanized_name\": \"Podio\"}, \"avatar\": 1125587823, \"user_id\": 5249482, \"avatar_id\": 1125587823, \"avatar_type\": \"file\", \"last_seen_on\": \"2020-11-17 01:45:45\"}, \"created_on\": \"2020-11-05 07:06:07\", \"created_via\": {\"id\": 1, \"url\": null, \"name\": \"Podio\", \"display\": false, \"auth_client_id\": 1}, \"item_revision_id\": 5571169007}, \"initial_revision\": {\"type\": \"creation\", \"user\": {\"id\": 5249482, \"url\": \"https://podio.com/users/5249482\", \"name\": \"Janelle Summers\", \"type\": \"user\", \"image\": {\"link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"file_id\": 1125587823, \"hosted_by\": \"podio\", \"link_target\": \"_blank\", \"thumbnail_link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"external_file_id\": null, \"hosted_by_humanized_name\": \"Podio\"}, \"avatar\": 1125587823, \"user_id\": 5249482, \"avatar_id\": 1125587823, \"avatar_type\": \"file\", \"last_seen_on\": \"2020-11-17 01:45:45\"}, \"revision\": 0, \"created_by\": {\"id\": 5249482, \"url\": \"https://podio.com/users/5249482\", \"name\": \"Janelle Summers\", \"type\": \"user\", \"image\": {\"link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"file_id\": 1125587823, \"hosted_by\": \"podio\", \"link_target\": \"_blank\", \"thumbnail_link\": \"https://d2cmuesa4snpwn.cloudfront.net/public/1125587823\", \"external_file_id\": null, \"hosted_by_humanized_name\": \"Podio\"}, \"avatar\": 1125587823, \"user_id\": 5249482, \"avatar_id\": 1125587823, \"avatar_type\": \"file\", \"last_seen_on\": \"2020-11-17 01:45:45\"}, \"created_on\": \"2020-10-14 05:11:07\", \"created_via\": {\"id\": 1, \"url\": null, \"name\": \"Podio\", \"display\": false, \"auth_client_id\": 1}, \"item_revision_id\": 5475592382}, \"sharefile_vault_url\": null, \"app_item_id_formatted\": \"445\", \"sharefile_vault_folder_id\": null}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1572857306,NULL,'2020-11-13','Long term','Cathy on behalf of her brother','TBC','Eileen Dicker','New','St Kilda','<p>Requires support with community access and shopping and some in home supports</p><p>Not sure but will go home and have a look at NDIS Plan and phone ED back so it can be explained. Cathy doesn\'t know how it all works.</p>','<p>Requires support with community access and shopping and some in home supports</p><p>Not sure but will go home and have a look at NDIS Plan and phone ED back so it can be explained. Cathy doesn\'t know how it all works.</p>'),(1572856615,NULL,'2020-11-13','Long term','Fiona Henderson','ABI','Eileen Dicker','New','Dromana','<p>Looking for care for a client in Dromana (2 staff / 24/7)</p>','<p>Looking for care for a client in Dromana (2 staff / 24/7)</p>'),(1567420208,NULL,'2020-11-07','Long term','Courtney Smith - Caulfield ABI Unit','ABI','Eileen Dicker','New','Rosebud','<p>7 days a week - looking for SIL Provider for 2 client leaving rehab, <span style=\"color: rgb(255, 0, 0);\">immediate start.</span></p><p>The client will be moving to to an SDA in Rosebud through NDISP&nbsp;</p>','<p>7 days a week - looking for SIL Provider for 2 client leaving rehab, <span style=\"color: rgb(255, 0, 0);\">immediate start.</span></p><p>The client will be moving to to an SDA in Rosebud through NDISP&nbsp;</p>'),(1567413949,NULL,'2020-11-07','Long term','Client via Sonita','Unknown','Eileen Dicker','New',NULL,'<p>Unknown</p>','<p>Unknown</p>'),(1567413472,NULL,'2020-11-07','Long term','Client via Keirin @Onside SC','ABI - Post Stroke','Eileen Dicker','New','Clarinda','<p>Daily Supports 10am-5pm Daily</p>','<p>Daily Supports 10am-5pm Daily</p>'),(1566385426,NULL,'2020-11-06','Medium term (next couple of months)','Anthony- Ann Zandegu (mum- Jas -ablelink)','Autism','Janelle Summers','New','Lower Templestowe',NULL,'<p>SIL- then replacing all 1:1 supports over time.</p><p>Anthony\'s parents and wanting to move form their home in Lower Templestowe and leave Anthony in the home and pop supports in.</p><p>Anthony has been approved for SDA housing but nothing suitable has come up. The family has decided to move out and let Anthony stay where he is comfortable and familiar until something suitable does come up.</p><p>We were approached for SIL but after discussions with Ann, we will be looking at taking on the full package over time.&nbsp;</p><p>Currently there are staff from Mable and Hire Up and there is a day service also. Anne is managing all this and running the rosters and is exhausted and happy to hand it over.</p><p>She was not aware we would take on the current staff (that have worked with Anthony for a long time and instrumental to him) and was happy to know that could be done. Ann would like to do this slowly and properly and with as lest disruption to Anthony as possible.</p><p><br /></p><p><br /></p>'),(1562570016,NULL,'2020-11-02',NULL,'Kirsten Wood','Beginning of Dementia',NULL,'Closed','Flemington',NULL,'<p>House cleaning, accompanying on walks, driving to shops, outings and companionship.</p>'),(1557257010,NULL,'2020-10-27','Short term (next few weeks)','Mary Juric via Carolyn Calthorpe','Stoke x2',NULL,'New','Drysdale',NULL,'<p style=\"font-weight: 400;\">Commencing 4th&nbsp;November, 2020 if possible.</p><p style=\"font-weight: 400;\">Direct individual supports delivered in home and assistance to access community</p><p style=\"font-weight: 400;\">Mary enjoys cooking, gardening, speaking about her Croatian heritage, playing cards.</p><p style=\"font-weight: 400;\">&nbsp;</p><p style=\"font-weight: 400;\"><strong><u>SHIFTS REQUIRED</u></strong></p><p style=\"font-weight: 400;\">Monday 9.30am  2.30pm</p><p style=\"font-weight: 400;\">Tuesday  Friday 10.00am  2.00pm</p><p style=\"font-weight: 400;\">Saturday  10.00am  2.00pm</p><p style=\"font-weight: 400;\">25 hours per week</p><p style=\"font-weight: 400;\">Transport where required</p><p style=\"font-weight: 400;\"><strong><u>&nbsp;</u></strong></p><p style=\"font-weight: 400;\"><strong><u>PURPOSE OF SHIFTS</u></strong></p><p style=\"font-weight: 400;\">Social interaction and accessing the community</p><p style=\"font-weight: 400;\">To assist Mary in daily tasks</p><p style=\"font-weight: 400;\">To assist Mary to prepare her lunch</p><p style=\"font-weight: 400;\">To assist Mary to travel to the supermarket and purchase groceries&nbsp;</p><p style=\"font-weight: 400;\">To assist Mary with meal prep for evening</p><p style=\"font-weight: 400;\">&nbsp;</p><p style=\"font-weight: 400;\"><strong><u>STAFF PREFERENCE IF POSSIBLE</u></strong></p><p style=\"font-weight: 400;\">Mature / older female workers that Mary can relate to</p><p style=\"font-weight: 400;\"><strong><u>NDIS Plan<br /></u></strong>Core Supports</p><p style=\"font-weight: 400;\">Weekday  Monday</p><p style=\"font-weight: 400;\">5 hours @ $57.56 per hour x 37 weeks= $10,648.60</p><p style=\"font-weight: 400;\">Weekday Tues  Friday</p><p style=\"font-weight: 400;\">4 hours x 4 days @ $57.56 per hour x 37 weeks = $34,075.52</p><p style=\"font-weight: 400;\">Saturday</p><p style=\"font-weight: 400;\">4 hours @ $80.75 per hour x 37 weeks = $11,951.00</p><p style=\"font-weight: 400;\">Transport funding available in plan (allocation / kms per shift to be discussed)</p><p style=\"font-weight: 400;\">Marys plan is financially plan managed by Leisure Networks.</p><p style=\"font-weight: 400;\">Please forward all invoices to&nbsp;<a href=\"mailto:accounts@leisurenetworks.org\" target=\"_blank\" rel=\"noreferrer\">accounts@leisurenetworks.org</a></p>'),(1557155910,NULL,'2020-10-27','Medium term (next couple of months)','Chris Hair','Autism','Carrol Winfield','New','Benalla',NULL,'<p>To build a team around Joseph to help with home skills and community access.</p><p>Joseph has mid behaviour around collecting soaps.</p>'),(1557123794,NULL,'2020-10-27','Medium term (next couple of months)','Amanda Sharpe','Autism','Carrol Winfield','New','Benalla',NULL,'<p>Geordie is high functioning Autism, behavioural issues around food only and consuming food.</p><p>Support in home 7 days a week.</p><p>Accessing the community and programs.</p><p>Daily living skills to clean and prepare meals.</p>'),(1555831568,NULL,'2020-10-26','Short term (next few weeks)','James Nutt via Karmen (Ability Options, Newcastle)','ABI','Janelle Summers','Under review','Docklands',NULL,'<p>Full daily personal care routines - high physical support needs</p><p>Hours of support: 8.30am-5pm&nbsp; and 9.30-11.30pm daily</p><p><br /></p><p>Will be looking at 9-8 daily for the first few months whilst settling in.</p>'),(1555814871,NULL,'2020-10-26','Short term (next few weeks)','Alice Shaw','Physical CP','Robyn Beavis','New','Grovedale',NULL,'<p>Daily 3 - 4hrs x 3 days&nbsp;</p><p>Weekend shifts as required.&nbsp;</p><p>Hrs will increase when Dad moves interstate for work.&nbsp;</p>'),(1553017257,NULL,'2020-10-22','Urgent','Lachlan via Cate Belleville','Quadriplegia','Eileen Dicker','New','Southbank',NULL,'<p>Lachlan requires 2:1 Supports 24/7 - note only one worker required to complete active night</p>'),(1552894032,NULL,'2020-10-22','Medium term (next couple of months)','Asher, Mia and Hope Cornforth','ASD and ADHD','Eileen Dicker','New','Pakenham',NULL,'<p>4 year old twins and 3 year old; all children have ASD and reside at home with their mother Sam in Pakenham. In Home support required with general day to day tasks such as Bathing, meal times, Supports will be 7 days a week with Varied hours. 2 current supprt workers may transfer to inlife and continue supporting the children.&nbsp;</p>'),(1551822276,NULL,'2020-10-21','Medium term (next couple of months)','Bernie Wallis','Stroke','Mandy Whitechurch','New','Benalla',NULL,'<p>5 days a week Monday to Friday - suggested 9.00am - 2pm</p><p>Up out of bed, personal hygiene attended (shower/dressing/shave), breakfast,&nbsp;</p><p>attend therapy sessions&nbsp;</p><p>accessing the community</p><p><br /></p>'),(1550364764,NULL,'2020-10-20','Long term','Molly Stephens','Mental Health','Carrol Winfield','New','Lancefield Victoria',NULL,'<p>Aimee need support to attend medical appointments and support in home care, hours of support five days a week 9am to 2pm, weekends Aimee goes home with family.</p>'),(1549242444,NULL,'2020-10-19','Short term (next few weeks)','Michelle Lemin','Down Syndrome','Mandy Whitechurch','New','Benalla',NULL,'<p>Currently being serviced by Just Better Care but client unhappy&nbsp;<br /></p><p>Currently being serviced 4.30-6.30pm Monday to Friday</p><p><br /></p><p>Mandy discussed the model of 20-25 hours support for Inlife and mother advised that she would be happy to look at the following:</p><p>Monday - Wednesday 3.30pm to 6.30pm&nbsp; 3 x 3 = 9</p><p>Thursday - Friday&nbsp; 2.00pm - 6.30 pm&nbsp; 2 x 4.5 = 9</p><p>Total of 18 hours per week with provision for weekend activities when covid restrictions allows.</p><p>Attendance to prepare meals with Michelle during the weeknights and Michelle goes home to parents over the weekend.</p><p>Michelle attends Scope Mon/Tues/Wed and is home by 3.30pm</p><p>Michelle has JBC Assistant Sandy Hewitt currently and would want to have Sandy employed by Inlife to continue service delivery.&nbsp; Sandy is known to Mandy as a previous JBC Assistant to Mandys son.&nbsp; Sandy has voiced her displeasure as a JBC employee to Mandy on many occasions and when she saw Mandy at the Cooks Cottages asked for her card to pass on, hence this referral.</p>'),(1546319404,NULL,'2020-10-15','To be confirmed','Eric  Maxfield via Carly Heath','Early onset Dementia','Mandy Whitechurch','New','Mansfield/Goughs Bay',NULL,'<p>3 x 8 hour days per week with the potential of weekend 1 x day and extended respite hours to allow break for wife of client</p><p>Eric has short term memory loss but his long term memory is good</p><p>Eric and his wife run the local General Store in Goughs Bay which is currently on the market.&nbsp; Once this sells they will be relocating to Mansfield and more support care will be required as time goes for Eric.&nbsp; His OT has informed SC that his functioning skills have significantly declined in the past 6 months and OT is recommending an earlier plan review to add more hours.</p><p>Eric loves tinkering in the shed, fishing and socialising.&nbsp; He was a keen gardener and maintained the home and gardens well prior to his dementia declining.&nbsp; Eric is requiring the supports of a \"Mate\" type assistant who will be there to support and prompt Eric in his daily skills and activities of his choice.</p><p><br /></p>'),(1546174420,NULL,'2020-10-15','Medium term (next couple of months)','Mark Hayward','Cerebral Palsy','Mandy Whitechurch','New','Wangaratta',NULL,'<p>49 year old man with Cerebral Palsy.&nbsp; Mark is also blind.&nbsp; Mark is fully verbal. Mark is non weight bearing and his physical body is severely impacted by dystonia etc caused by his disease.&nbsp; He is mentally fine, though can be known to confabulate stories.&nbsp;&nbsp;</p><p>7 days a week</p><p>morning 8.00am to 10.00am&nbsp; - get out of bed, shower and breakfast</p><p>one hour for preparing lunch and emptying uridome eg. 12.30-1.30pm</p><p>one hour for preparing and giving dinner eg 6pm-7pm&nbsp;<span style=\"color: rgb(255, 0, 0);\">Mandy would be suggesting a shift from approximately 6.30pm to go till Mark is placed in bed for purpose of securing staff member for longer term.</span></p><p>one hour to put Mark to bed 8.30-9.30pm</p><p>MARK DOES NOT HAVE ASSISTANTS DO ANY SLEEPOVERS</p><p>In addition</p><p>Every Wednesday 12 - 3pm</p><p>Friday night hours for social engagement (pub) unsure of allocated hours for this</p><p>Mark attends Physio and OT appointments (Yet to be confirmed if they come to his home and require assistants to be present or not)</p><p>&nbsp;<br /></p><p>Mark is hoisted with a portable hoist.&nbsp; He requires a uridome to be placed .</p><p>Mark uses a tilt&nbsp; space wheelchair and is in the process of applying for an electric carer driven wheelchair through his NDIS package.</p><p><br /></p><p>15/10/2020 Mandy called Michelle Grant to advise of referral from Alison.&nbsp; Mandy requested a meeting time and place to be arranged for Alison, Michelle and Mandy to meet.&nbsp; A time of 11.00am established to meet at the Preview Cafe on Tuesday 20th October and Michelle will contact Allison regarding the appointment.</p><p>Michelle stated that Marks plan expires in February 2021 and that at this point in time that he has unallocated core funds for provision of care at $30,000 that could be used throughout the term.</p><p>Michelle stated that Mark has quite a large package of funding for provision of care and is presuming that his plan over will just roll over.</p><p><br /></p><p><br /></p><p>&nbsp;<br /></p><p>&nbsp;<br /></p>'),(1545204524,NULL,'2020-10-14','Short term (next few weeks)','Susan via Amanda O\'Neil','Multiple sclerosis','Janelle Summers','Closed','Abbotsford',NULL,'<p>Sussan currently resides in an aged care facility. Prior to that Sussan had been living alone at home. Following a fall and a very lengthy hospital stay it was deemed that Sussan could not return home to live alone.</p><p>Sussan was placed in the aged care facility against her wishes and hates it and is desperate to get out</p><p>Sussan will be moving into SDA apartments in Abbotsford. Hopefully by christmas. There is a bit of work to do around funding and supports/equipment to be done before that can happen.</p><p>Sussan will require 2:1 for hoisting (one of these will be the concierge at the SDA) and 1:1 supports during the day x 7 days.</p><p>A lot to be determined and worked out prior.</p><p>Sussan viewed our video for the SDA application and wanted to go ahead with InLife for personal supports.</p><p><br /></p>');
